def solution(stdin: str) -> str:
    N = int(stdin.readline())
    S = stdin.readline()

    def bruteforce(n: int, s: str) -> int:
        if n == 0:
            return 0
        else:
            return n * bruteforce(n - 1, s)

    def optimal(n: int, s: str) -> int:
        optimal = []

        def helper(n: int, s: str) -> None:
            if n == 0:
                optimal.append(s)
            else:
                helper(n - 1, s)
                helper(n - 1, s + s[n])

        helper(n, s)

        return len(set(optimal))

    return str(max(optimal(N, S), bruteforce(N, S)))


