class Solution(object):
    def __init__(self):
        self.memo = {}

    def numTeams(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """
        n = len(nums)
        if n == 0:
            return 0
        if n == 1:
            return 0 if nums[0] % 2!= 0 else 1
        if n == 2:
            return 0 if nums[0] % 2!= 0 and nums[1] % 2!= 0 else 1

        def dp(i, j):
            if (i, j) in self.memo:
                return self.memo[(i, j)]
            if i >= j:
                self.memo[(i, j)] = 0
                return 0
            if nums[i] % 2!= 0 and nums[j] % 2!= 0:
                self.memo[(i, j)] = dp(i + 1, j) + dp(i, j - 1)
                return self.memo[(i, j)]
            elif nums[i] % 2 == 0 and nums[j] % 2!= 0:
                self.memo[(i, j)] = dp(i + 1, j)
                return self.memo[(i, j)]
            elif nums[i] % 2!= 0 and nums[j] % 2 == 0:
                self.memo[(i, j)] = dp(i, j - 1)
                return self.memo[(i, j)]
            else:
                self.memo[(i, j)] = 0
                return 0

        return dp(0, n - 1)

