    def dfs(i, j) -> int:
        if grid[i][j] == 'L':
            if not check_neighbors(i, j):
                return 0
            grid[i][j] = 'X'
            return 1 + dfs(i - 1, j) + dfs(i + 1, j) + dfs(i, j - 1) + dfs(i, j + 1)

